		<item>
			<title>News Article: Thu, 20 Dec 2012</title>
			<link>http://www.misfile.com/#news</link>
			<description>Taking off in the morning.  Remember: December 31st is the last day to get this month's extremely popular pin!  I'm trying to get the pin image updated on time on New Year's Eve, but even if I don't, all donations received after midnight on December 31st will go towards January's pin!</description>
			<pubDate>Thu, 20 Dec 2012 00:00:00 GMT</pubDate>
			<guid>http://www.misfile.com/news.php?date=2012-12-20#25557</guid>
