			<title>News Article: Wed, 19 Dec 2012</title>
			<link>http://www.misfile.com/#news</link>
			<description>I'll be out of town from the 21st through new years.  That means no commissions or answered emails or anything.  Updates will still occur.  Some pages, some guest pages, some special pages.  Merry Christmas and happy New Years.</description>
